import React from 'react'
import { useNavigate } from 'react-router-dom'

 const Rating = () => {
    const navit=useNavigate()
    const arro=()=>{
        navit("/Address")
    }
    return (
        <div>
            <div>
            <button className="" onClick={arro}>&lt;</button>
            <img src="/asset/ball (1).png" alt="" />
            <img src="/asset/piu.png" alt="" />
            <h3>Pizza Hut</h3>
            <p>4002 pretty view</p>
            <p>order Delivered</p>
            <h4>Please Rate Delivery Service</h4>
            <h5>G</h5>
            </div>
        </div>
    )
}

export default Rating
